import React from 'react';
import ButtonBase from '@mui/material/ButtonBase';
import './Tile.css';
import birdhouse from './images/birdhouse.png';

const Tile = (props) => {
    return(
        <div className="Tile">
            <ButtonBase>
                <div>
                    <img className='tileIcon' src={'https://img.icons8.com/fluency/96/000000/'+props.image+'.png'} />
                    <img className='Folder' src='https://img.icons8.com/fluency/96/000000/folder.png' alt="" />

                </div>
                <p>{props.name || 'Untitled'}</p>
            </ButtonBase>
        </div>
    );
}

export default Tile;
